INSERT INTO `teacherquestion` VALUES ('1', '课前测试：讲师是否能坚持进行课前测试，及时激励和督促学生的学习');
INSERT INTO `teacherquestion` VALUES ('2', '上课准时：准时上课，每天第一节课提前5分钟进班');
INSERT INTO `teacherquestion` VALUES ('3', '授课水平：讲师的授课内容条理清晰、表达准确、操作熟练、逻辑性强');
INSERT INTO `teacherquestion` VALUES ('4', '课堂气氛：课堂气氛活跃，你对所学知识感兴趣并能积极参与');
INSERT INTO `teacherquestion` VALUES ('5', '课堂巡视：在做练习或项目时讲师是否保持在班内巡视，随时监督学生进度、及时发现并解决问题');
INSERT INTO `teacherquestion` VALUES ('9', '课后总结：讲师在课程结束时能及时总结，便于我对知识点的理解、掌握');
INSERT INTO `teacherquestion` VALUES ('11', '作业指导：讲师对作业或练习中的问题都会及时集中讲解或单个点评');
INSERT INTO `teacherquestion` VALUES ('12', '关心学生：讲师对我能严格要求，并且对你的进步能及时表扬，鼓励');
INSERT INTO `teacherquestion` VALUES ('13', '诚实守信：讲师能诚实讲授知识，从不诱导我为其授课结果虚高打分');
INSERT INTO `teacherquestion` VALUES ('14', '认真负责：讲师对学生认真负责，责任心强。');
